import { Link } from "react-router-dom";

const Navbar = ({ user }) => {
    if(user !== undefined){
        return(
            <ul className="list">

                <li className="listItem">
                    {user.userName}
                </li>
                <li className="listItem">
                    <img
                        src={user.avatar}
                        alt=""
                        className="avatar"
                    />
                </li>
                <li className="listItem">
                    <Logout />
                </li>
            </ul>
        )
    }

    return(
        <ul className="list">
            <li className="listItem">
            <Link className="link" to="login">
                Login
            </Link>
            </li>
        </ul>
    )
}

export default Navbar;
